import React, {Component} from 'react'
import {BrowserRouter as Router, Route, Link} from 'react-router-com'
import LogIn from './LogIn-page/LogIn.js'

class App extends React.Component {
    render() {
        return(
            <Router>
                <div> 
                    <a href = './LogIn-page/LogIn.js' target = "_blank"> Click here to see Ignacio's component </a>
                    <h1> FeastMode </h1>
                </div>
            </Router>
        )
    }
}

export default App
